import React from 'react'
import {useCookies} from 'react-cookie';

function LogOut() {

    const [token] = useCookies(['mytoken'])
    return (
        <div className="Dashboard" token={this.state.token} >
                <div>Dashboard</div>
                <button onClick={this.logout}>Logout</button>
            </div>
    )
}

export default LogOut
